import React from 'react';
import './Main.css'

//components
import Section from './Section/Section';


const Main = () => {
    return (
    <div className="container">
        <Section id='aboutme' title='About Me' children={null}/>
        <Section id='skills' title='Skills' children={null}/>
        <Section id='projects' title='Projects' children={null}/>
    </div>
    );
}

export default Main;
